"157212":{"id":"157212","name":"Projeto Renner","slug":"projeto-renner","original_title":"Rennervations","overview":"Esta série em quatro partes mostra a paixão de Jeremy Renner por ajudar comunidades pelo mundo reformando e adaptando veículos para atender às necessidades da população. Fora das telonas, Jeremy é apaixonado por construir, seguindo a linha de fabricação criativa que vem tomando o mundo, e espera mudar a vida dos membros destas comunidades, além de inspirar outras pessoas a fazer o mesmo.","first_air_date":"2023-04-12","episode_run_time":0,"vote_average":8.1,"number_of_seasons":1,"number_of_episodes":4,"created_by":[],"production_companies":["Boardwalk Pictures"],"genres":["Documentário","Reality"],"certification":"10","backdrop_path":"https://image.tmdb.org/t/p/original/6j716XgRVraH9snx76JbhFtLdwW.jpg","poster_path":"https://image.tmdb.org/t/p/original/hQS5DbLA2eEKqLHEVGdReuKI1rp.jpg","cast":["Jeremy Renner","Rory Millikin","Corey Wardleig","Rob 'Bender' Park","Roxy Bonilla"],"trailer":"6b8vJCqMv1k","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/hQS5DbLA2eEKqLHEVGdReuKI1rp.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/hQS5DbLA2eEKqLHEVGdReuKI1rp.jpg","air_date":"2023-04-12","episode_count":4,"overview":"N/A","vote_average":9.3,"episodes":{"1":{"name":"Chicago: Construindo um Ônibus Musical (com Vanessa Hudgens)","overview":"Jeremy Renner, seu melhor amigo, Rory, e uma equipe de elite transformam um antigo ônibus de turnê em um estúdio móvel para o THE BASE Chicago, uma organização que promove atividades extracurriculares para manter crianças de comunidades periféricas longe das ruas e ajudá-las a encontrar e expressar sua voz artisticamente. A atriz e cantora Vanessa Hudgens ajuda na revelação do resultado final.","air_date":"2023-04-12","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/4nhomudLujvbirtfo6V9CYaRapk.jpg","vote_average":8},"2":{"name":"México: Construindo um Estúdio de Dança Móvel (com Sebastián Yatra)","overview":"Jeremy e seu melhor amigo, Rory, convertem um ônibus em um estúdio de dança para a Casa Hogar, uma instituição de caridade que oferece acolhimento e cuidado em tempo integral para crianças em Los Cabos, no México. Ao saber que a instituição perdeu seu estúdio, Jeremy e sua equipe de construtores de elite montam um novo local para as aulas e apresentações de dança, contando com a ajuda do cantor Sebastián Yatra para a grande revelação.","air_date":"2023-04-12","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/4jgg1FNHCrSG1WUBC7iWwhEqmY2.jpg","vote_average":10},"3":{"name":"Reno: construindo um centro recreativo móvel (com Anthony Mackie)","overview":"Jeremy Renner, seu melhor amigo, Rory, e sua equipe de construtores de elite convertem um ônibus em um centro de lazer móvel para o Big Brothers Big Sisters, uma instituição de caridade em Reno, no estado de Nevada, que oferece mentoria para crianças locais. A equipe precisa descobrir como encaixar uma cesta de basquete, uma trave de futebol e uma sala de computação no mesmo ônibus! Anthony Mackie ajuda na revelação final.","air_date":"2023-04-12","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/lgxqewepaNSHXaAqp4dvWUPYcBz.jpg","vote_average":10},"4":{"name":"Índia: Construindo uma Estação Móvel de Tratamento de Água (com Anil Kapoor)","overview":"Jeremy e seu melhor amigo, Rory, viajam pela primeira vez à Índia para conhecer a Uva Jagriti Sansthan, uma ONG que busca levar água potável para os vilarejos do país. Com a ajuda de uma equipe local de elite e de seu colega de Missão: Impossível, o ator indiano Anil Kapoor, Jeremy transforma um caminhão de entregas em uma unidade móvel de tratamento de água.","air_date":"2023-05-03","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/lHbD56AsQjmzV6zEV35mWLa9xLd.jpg","vote_average":0}}}}},
