"275630":{"id":"275630","name":"O Caso Robinho","slug":"o-caso-robinho","original_title":"O Caso Robinho","overview":"Em sua primeira entrevista, a vítima dá sua versão sobre o estupro envolvendo Robinho e cinco amigos. Um caso que chocou o Brasil, desvendado a partir de grampos da polícia italiana.","first_air_date":"2024-10-30","episode_run_time":0,"vote_average":9.5,"number_of_seasons":1,"number_of_episodes":4,"created_by":[],"production_companies":["Estúdios Globo"],"genres":["Documentário"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/oBQHv3e3HYRk5CuN8zbCHXGy242.jpg","poster_path":"https://image.tmdb.org/t/p/original/mGr9TJHzopizzbqBuAC57xdAG5I.jpg","cast":["Robinho"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/9vtIJVnMSqdhtOSeNuA4bSI6GoY.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/9vtIJVnMSqdhtOSeNuA4bSI6GoY.jpg","air_date":"2024-10-30","episode_count":4,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Meu Nome é Mercedes","overview":"A vítima dá entrevista pela primeira vez sobre o estupro. A polícia instala escutas nos telefones e no carro de Robinho e inicia a investigação para elucidar o caso.","air_date":"2024-10-30","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/yPEy6JbOk5GmP88UoVctZP9MbBr.jpg","vote_average":0},"2":{"name":"In Filo Veritas","overview":"Os grampos revelam as conversas entre Robinho e os amigos sobre a noite no Sio Café. A mulher de Robinho descobre os detalhes da acusação. Surge uma nova prova na investigação.","air_date":"2024-10-30","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/1NSA0puoZUUg2R57I4X7lKQpk9R.jpg","vote_average":0},"3":{"name":"O Julgamento","overview":"Robinho e Falco deixam Milão. Eles são julgados em primeira instância e seguem vivendo normalmente. Mas a volta de Robinho ao Santos traz nova repercussão ao caso.","air_date":"2024-10-30","runtime":28,"still_path":"https://image.tmdb.org/t/p/original/s7OC7az0ruAAP8W2fSziav0qI7i.jpg","vote_average":0},"4":{"name":"Sentença Final","overview":"Robinho encerra a carreira após a repercussão do caso. Ele e Falco são condenados em última instância na Itália. A justiça brasileira decide sobre o cumprimento da pena no país.","air_date":"2024-10-30","runtime":28,"still_path":"https://image.tmdb.org/t/p/original/x59up3lOJ6v5hO0eGutwyT1gBbl.jpg","vote_average":0}}}}},
"88987":{"id":"88987","name":"Helstrom","slug":"helstrom","original_title":"Helstrom","overview":"Daimon e Ana Hellstrom são dois irmãos que embarcam numa caça contra seu pai, um misterioso e poderoso serial killer.","first_air_date":"2020-10-16","episode_run_time":50,"vote_average":6.695,"number_of_seasons":1,"number_of_episodes":10,"created_by":["Paul Zbyszewski"],"production_companies":["Marvel Television","ABC Signature Studios","Lone Lemon Entertainment"],"genres":["Action & Adventure","Sci-Fi & Fantasy","Drama"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/qCReQONjNVaW4QFN2V5vCOzPvex.jpg","poster_path":"https://image.tmdb.org/t/p/original/5QmcKsepYpO9XYsWNLwsiULoaAu.jpg","cast":["Tom Austen","Sydney Lemmon","Elizabeth Marvel","Robert Wisdom","June Carryl"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/8fPIcaRIZgsoBcgA5yAm3GNz61M.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/8fPIcaRIZgsoBcgA5yAm3GNz61M.jpg","air_date":"2020-10-16","episode_count":10,"overview":"N/A","vote_average":6.3,"episodes":{"1":{"name":"Ajudantes da mamãe","overview":"Daimon Helstrom investiga um jovem possuído em Oregon. Enquanto isso, em São Francisco, Ana Helstrom realiza um leilão para expor um criminoso. Eventos perturbadores em Santa Teresa causam preocupação quando os irmãos afastam a mãe, que permanece hospitalizada.","air_date":"2020-10-16","runtime":56,"still_path":"https://image.tmdb.org/t/p/original/fGFuSOOkkhM0XdVFm2ZT20k45Qg.jpg","vote_average":6.2},"2":{"name":"Viaticum","overview":"Um terrível acidente leva Daimon e Gabriella a lutar para salvar a alma de um homem, enquanto uma força sombria tenta impedi-los. Enquanto isso, o relacionamento de Yen com seu trabalho dá uma guinada sombria em relação à obsessão, e uma descoberta leva Ana de volta à Santa Teresa.","air_date":"2020-10-16","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/kWtj4BSk5venJsgq19vn1Zf1PsY.jpg","vote_average":6.8},"3":{"name":"Aquela que fugiu","overview":"Daimon e Ana aprendem mais sobre a destruição que seu pai deixou em seu rastro. Com Gabriella, eles visitam uma vítima em potencial e se encontram mais profundamente do que jamais poderiam ter imaginado. Hastings choca Caretaker com uma revelação impressionante.","air_date":"2020-10-16","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/qNlyrjlquyltDgK4wRJhAp3srwv.jpg","vote_average":6.5},"4":{"name":"Contenção","overview":"Um inimigo demoníaco reúne um grupo incomum. Daimon e Ana viajam para São Francisco em busca de Yen e um artefato que pode ajudar a derrotar o inimigo. Ana conta a Daimon sobre suas atividades extracurriculares, e a fé de Gabriella é colocada a prova.","air_date":"2020-10-16","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/gLN0Wsa3sxfDc1RN0ONJKtQGUUp.jpg","vote_average":6.4},"5":{"name":"Comprometido","overview":"As coisas não são o que parecem, pois a saúde da Mãe diminui consideravelmente. Enquanto Ana procura Yen, Gabriella oferece conselhos a um aluno que luta para entender como os demônios vivem entre nós. Daimon faz uma descoberta que é realmente uma questão de vida ou morte.","air_date":"2020-10-16","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/jYHzNRHtfjrRHig3efvtC4cCdrM.jpg","vote_average":6.267},"6":{"name":"Leviatã","overview":"Uma força sombria força Hastings e Ana a trabalharem juntos. Daimon e Gabriella descobrem que os eventos do Blood Hotel estão conectados. A identidade do demônio é revelada, abalando profundamente Ana e Daimon. Yen fica em vantagem.","air_date":"2020-10-16","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/m7ZZkUBNBXfTlFjbCES1AyKCq4Q.jpg","vote_average":6.533},"7":{"name":"Cicatrizes","overview":"Com um demônio poderoso procurando um novo hospedeiro e Ana lutando para controlar seus desejos mais sombrios, Daimon recebe uma proposta de The Blood. O Zelador se encontra em perigo, e o Dr. Hastings abala Daimon com novas revelações sobre seu passado.","air_date":"2020-10-16","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/6vxZlU1aNORzk5j4bh0BSDCFI0B.jpg","vote_average":6.1},"8":{"name":"Por baixo","overview":"Os relacionamentos se aprofundam à medida que as apostas aumentam. Para salvar uma vida, Hastings e Ana devem fazer o impensável. Gabriella e Daimon viajam para sua casa de infância em busca de uma antiga relíquia. Uma mãe perde um filho, mas ganha um herdeiro.","air_date":"2020-10-16","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/5TZV34spa6I0GOeoh3uSRaakfl.jpg","vote_average":6.1},"9":{"name":"Embarcações","overview":"Daimon e Gabriella encontram-se em um novo território perturbador. Ana precisa tomar uma decisão que mudará o curso da vida dos irmãos de maneira irreversível. Victoria tenta fazer as pazes, mas pode ser tarde demais.","air_date":"2020-10-16","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/n7o165OTfAI8tW8SCLP2ydD7KpY.jpg","vote_average":6.1},"10":{"name":"Tempestade do inferno","overview":"Ana e Daimon lutam para salvar uma alma, mas apenas Yen pode sair vitorioso. A nova perspectiva de Gabriella desafia as crenças de Daimon, criando conflitos entre o grupo. Victoria se une a Daimon e Ana, mas sua vitória tem um custo.","air_date":"2020-10-16","runtime":56,"still_path":"https://image.tmdb.org/t/p/original/qx8mP3jX3kROOqzhXBZMDnUiX3b.jpg","vote_average":6}}}}},
